import React, { useState } from 'react';
import AnalyticsChart from '../../components/AnalyticsChart';
import StatusIndicator from '../../components/StatusIndicator';

const Statistics = () => {
  const [timeRange, setTimeRange] = useState('week');

  // Пример данных для графиков
  const salesData = {
    week: {
      labels: ['Пн', 'Вт', 'Ср', 'Чт', 'Пт', 'Сб', 'Вс'],
      data: [1200, 1900, 1500, 2100, 1800, 2500, 2200]
    },
    month: {
      labels: ['Неделя 1', 'Неделя 2', 'Неделя 3', 'Неделя 4'],
      data: [8000, 9500, 11000, 12000]
    },
    year: {
      labels: ['Янв', 'Фев', 'Мар', 'Апр', 'Май', 'Июн', 'Июл', 'Авг', 'Сен', 'Окт', 'Ноя', 'Дек'],
      data: [25000, 28000, 32000, 35000, 38000, 42000, 45000, 48000, 52000, 55000, 58000, 62000]
    }
  };

  const ordersData = {
    week: {
      labels: ['Пн', 'Вт', 'Ср', 'Чт', 'Пт', 'Сб', 'Вс'],
      data: [5, 8, 6, 9, 7, 10, 8]
    },
    month: {
      labels: ['Неделя 1', 'Неделя 2', 'Неделя 3', 'Неделя 4'],
      data: [30, 35, 40, 45]
    },
    year: {
      labels: ['Янв', 'Фев', 'Мар', 'Апр', 'Май', 'Июн', 'Июл', 'Авг', 'Сен', 'Окт', 'Ноя', 'Дек'],
      data: [120, 130, 140, 150, 160, 170, 180, 190, 200, 210, 220, 230]
    }
  };

  // Метрики
  const metrics = [
    {
      title: 'Общий объем продаж',
      value: '45,000 TRX',
      change: '+12.5%',
      trend: 'up'
    },
    {
      title: 'Количество заказов',
      value: '156',
      change: '+8.2%',
      trend: 'up'
    },
    {
      title: 'Средний чек',
      value: '288 TRX',
      change: '-2.1%',
      trend: 'down'
    },
    {
      title: 'Конверсия',
      value: '3.2%',
      change: '+0.5%',
      trend: 'up'
    }
  ];

  return (
    <div className="p-6">
      <div className="flex justify-between items-center mb-6">
        <h1 className="text-2xl font-bold text-gray-900">Статистика</h1>
        <div className="flex space-x-2">
          <button
            onClick={() => setTimeRange('week')}
            className={`px-4 py-2 rounded-md ${
              timeRange === 'week' ? 'bg-blue-600 text-white' : 'bg-gray-200 text-gray-700'
            }`}
          >
            Неделя
          </button>
          <button
            onClick={() => setTimeRange('month')}
            className={`px-4 py-2 rounded-md ${
              timeRange === 'month' ? 'bg-blue-600 text-white' : 'bg-gray-200 text-gray-700'
            }`}
          >
            Месяц
          </button>
          <button
            onClick={() => setTimeRange('year')}
            className={`px-4 py-2 rounded-md ${
              timeRange === 'year' ? 'bg-blue-600 text-white' : 'bg-gray-200 text-gray-700'
            }`}
          >
            Год
          </button>
        </div>
      </div>

      {/* Метрики */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-6">
        {metrics.map((metric, index) => (
          <div key={index} className="bg-white p-6 rounded-lg shadow-md">
            <h3 className="text-sm font-medium text-gray-500">{metric.title}</h3>
            <div className="mt-2 flex items-baseline">
              <p className="text-2xl font-semibold text-gray-900">{metric.value}</p>
              <span
                className={`ml-2 text-sm font-medium ${
                  metric.trend === 'up' ? 'text-green-600' : 'text-red-600'
                }`}
              >
                {metric.change}
              </span>
            </div>
          </div>
        ))}
      </div>

      {/* Графики */}
      <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-lg font-medium text-gray-900 mb-4">Объем продаж</h2>
          <AnalyticsChart
            title="Объем продаж"
            data={salesData[timeRange].data}
            labels={salesData[timeRange].labels}
            color="blue"
          />
        </div>
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-lg font-medium text-gray-900 mb-4">Количество заказов</h2>
          <AnalyticsChart
            title="Количество заказов"
            data={ordersData[timeRange].data}
            labels={ordersData[timeRange].labels}
            color="green"
          />
        </div>
      </div>

      {/* Статус системы */}
      <div className="mt-6 bg-white p-6 rounded-lg shadow-md">
        <h2 className="text-lg font-medium text-gray-900 mb-4">Статус системы</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4">
          <div className="flex items-center space-x-2">
            <StatusIndicator status="active" />
            <span className="text-sm text-gray-600">API сервис</span>
          </div>
          <div className="flex items-center space-x-2">
            <StatusIndicator status="active" />
            <span className="text-sm text-gray-600">База данных</span>
          </div>
          <div className="flex items-center space-x-2">
            <StatusIndicator status="active" />
            <span className="text-sm text-gray-600">Блокчейн сеть</span>
          </div>
          <div className="flex items-center space-x-2">
            <StatusIndicator status="active" />
            <span className="text-sm text-gray-600">Уведомления</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Statistics;
